import React,{Component}from 'react';
import {View, StyleSheet,TextInput, Text, TouchableOpacity,ScrollView, Image} from 'react-native';

;import Icon from 'react-native-vector-icons/Ionicons';



export default class forgot extends Component{
    constructor(props){
        super(props)
        this.state={
           
        }
    }
     
    render(){ 
        
    
        
     
    
        return(
<ScrollView>
        <View  style={{backgroundColor: '#adf6d6',flex:1,justifyContent: 'center',alignItems: 'center'}}>
      
        <TouchableOpacity
            onPress={() => this.props.navigation.navigate('Login')}
            >
        <Image
            source={require('../../../../assets/TripLogo.png')}
            resizeMode="center"
            style={  {
    
                resizeMode: 'contain',
                width: 50,
                height: 50,
                marginTop:5
             
            }}
          />
          </TouchableOpacity>
        <TouchableOpacity onPress={()=>this.props.navigation.navigate('Topkapi')} style={{position:'absolute',right:'85%',top:0}}>
    <Icon  name={Platform.OS === "ios" ? "ios-add" : "arrow-back-circle-outline"}
  //name={(this.state.hidePassword)?"eye-off-outlane:eye-outlane"}  şifre görünürlüğü açıp kapatma
  color="black"
  size={55}/>
</TouchableOpacity>
        <View style={{alignItems:'center'}}> 
   <Text style={{color:'black',fontSize:30,alignItems:'center',justifyContent:'center'}}>
Topkapı Sarayı
     </Text>
     </View>
         <Text style={{margin:25,fontSize:25,color:'black'}}>
             
         The Topkapı Palace (Turkish: Topkapı Sarayı;[2] Ottoman Turkish: طوپقپو سرايى‎, romanized: Ṭopḳapu Sarāyı, lit. 'Cannon Gate Palace'),[3][4] or the Seraglio,[5] is a large museum in the east of the Fatih district of Istanbul in Turkey. In the 15th and 16th centuries it served as the main residence and administrative headquarters of the Ottoman sultans.

Construction, ordered by the Sultan Mehmed the Conqueror, began in 1459, six years after the conquest of Constantinople. Topkapı was originally called the "New Palace" (Yeni Saray or Saray-ı Cedîd-i Âmire) to distinguish it from the Old Palace [tr] (Eski Saray or Sarây-ı Atîk-i Âmire) in Beyazıt Square. It was given[by whom?] the name Topkapı, meaning Cannon Gate, in the 19th century.[6] The complex expanded over the centuries, with major renovations after the 1509 earthquake and the 1665 fire. The palace complex consists of four main courtyards and many smaller buildings. Female members of the Sultan's family lived in the harem, and leading state officials, including the Grand Vizier, held meetings in the Imperial Council building.             
         </Text>
         </View>
         
        </ScrollView>
        
        )
      
    }
    
}
